import logo from "./logo.svg";
import "./App.css";
import Dashboard from "./component/Dashboard";
import { BrowserRouter } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Dashboard />}>

          </Route>
        </Routes>
      </BrowserRouter>
      <Dashboard />
    </div>
  );
}

export default App;
